(1, 'authors/Yvonne_Kusiima.jpg', 'Yvonne', 'Kusiima', 'yvonnekusiima00@gmail.com', '+256771167290', '2000-03-07', 'Uganda', 'English', 'Poetry', 'I love writing.', '$2y$10$p2bCbRXrbX4PF20JJ/Ai/.zJg1ksKbGw5np5eerQZKfOcR10KAot2', 'Self Publish', NULL, 'East-African', '2022-07-20 02:51:14', 'yvonnekusiima00@gmail.com', 'Author', '', '', NULL, NULL),
(2, 'authors/Paul_Laurence_Dunbar.jpg', 'Paul Laurence', 'Dunbar', '', '', '1872-06-27', 'United States', 'African American English (AAE)', 'Poetry', 'Paul Laurence Dunbar (June 27, 1872 – February 9, 1906) was an American poet, novelist, and short story writer of the late 19th and early 20th centuries. Born in Dayton, Ohio, to parents who had been enslaved, Dunbar began writing stories when he was a child. With over a dozen published poetry collections, several short stories and novels and plays, Dunbar is a historical writer whose writing still holds significance today.', '', 'publishingagreements/Paul_Laurence_Dunbar.pdf', 'https://en.wikipedia.org/wiki/Paul_Laurence_Dunbar', 'African-American', '2022-07-20 10:58:29', 'Leap Publishers', 'Publisher', '', '', NULL, NULL),
(3, 'authors/Olaudah_Equiano.jpg', 'Olaudah', 'Equiano', '', '', '1745-01-01', 'Nigeria', 'Black English', 'African Biographies & Memoirs', 'Olaudah Equiano (c. 1745 – 31 March 1797), known for most of his life as Gustavus Vassa was a writer from the Igbo region of the Kingdom of Benin (known today as southern Nigeria). Enslaved as a child in Africa, he was taken to the Caribbean and sold as a slave to a Royal Navy officer. He was sold twice more but purchased his own freedom in 1766. As a freedman in London, Equiano supported the British abolitionist movement and was active among leaders of the anti-slave trade movement in the 1780s. He published his autobiography in 1789, which depicted the horrors of slavery. It went through nine editions in his lifetime and helped gain passage of the British Slave Trade Act 1807, which abolished the slave trade. Equiano was married to an English woman, Susannah Cullen, in 1792 and together they had two daughters. He died in 1797 in Westminster.', '', 'publishingagreements/Olaudah_Equiano.pdf', 'https://en.wikipedia.org/wiki/Olaudah_Equiano', 'Afro-European', '2022-07-20 11:06:38', 'Leap Publishers', 'Publisher', '', '', NULL, NULL),
(4, 'authors/Zora_Neale_Hurston.jpg', 'Zora Neale', 'Hurston', '', '', '1891-01-07', 'United States', 'African American English (AAE)', 'Dramas & Screenplays', 'Zora Neale Hurston (January 7, 1891  – January 28, 1960) was an American author, anthropologist, and filmmaker. She portrayed racial struggles in the early-1900s American South and published research reports, novels, short stories, plays and essays. The most popular of her four novels is \'Their Eyes Were Watching God,\' which was published in 1937. She is attributed with writing more than 50 short stories, plays, and essays throughout her lifetime and holds a significant part in African-American publishing history.', '', 'publishingagreements/Zora_Neale_Hurston.pdf', 'https://en.wikipedia.org/wiki/Zora_Neale_Hurston', 'African-American', '2022-07-20 11:14:20', 'Leap Publishers', 'Publisher', '', '', NULL, NULL),
(5, 'authors/James_Weldon_Johnson.jpg', 'James Weldon', 'Johnson', '', '', '1871-06-17', 'United States', 'African American Vernacular English (AAVE)', 'Historical Fiction', 'James Weldon Johnson (June 17, 1871 – June 26, 1938) was an American writer and civil rights activist. Johnson\'s first success as a writer was the poem \"Lift Ev\'ry Voice and Sing\" (1899), which his brother Rosamond later set to music; the song became unofficially known as the \"Negro National Anthem.\" His best-known book, The Autobiography of an Ex-Colored Man, was originally published anonymously in 1912, choosing anonymity to avoid any controversy that might endanger his diplomatic career. It was not until 1927 that Johnson acknowledged writing the novel, stressing that it was not a work of autobiography but mostly fictional. He is the author of several essays, poems and other literary works, which shaped African-American literature of the time.', '', 'publishingagreements/James_Weldon_Johnson.pdf', 'https://en.wikipedia.org/wiki/James_Weldon_Johnson', 'African-American', '2022-07-20 11:22:20', 'Leap Publishers', 'Publisher', '', '', NULL, NULL),
(6, 'authors/Martin_Lwanga.jpg', 'Martin', 'Lwanga', 'mlwang2001@gmail.com', '+256 772 401774', '1963-08-29', 'Uganda', 'English', 'Business & Management', 'Dr. Martin M. Lwanga is an author, management consultant and associate professor of business management. He served as Dean of Uganda Christian University Business School, Head of Management Department at Uganda Management Institute and as a lecturer at Makerere University. He devotes his time to teaching business students across universities in Africa, Europe, North America and Asia and has written over a dozen books in the area of business, management and Christian living.', '$2y$10$KbFreluH7u6yteKgnY2ENeoQ.slrad13on8JG1UXRpd6/2Za58mS2', 'Self Publish', 'https://drlwangamartinmwanje.com', 'East-African', '2022-07-20 11:53:14', 'mlwang2001@gmail.com', 'Author', '', '', NULL, NULL),
(7, 'authors/Henry_Muguluma.jpg', 'Henry', 'Muguluma', 'henrymuguluma@gmail.com', '+256 701 748184', '1981-10-27', 'Uganda', 'English', 'Christian Living', 'Henry Muguluma is an author, leadership coach, motivational speaker, and Christian leader. He writes in a variety of styles including; poetry, Christian living, young adult and devotionals . If you are looking to be a stronger leader or more purposeful Christian, Henry\'s writings are for you!', '$2y$10$nDsok8suMRBmCHkncp6tMebOg7ippqZxV2mi2sWaBt57QjeRq20YW', 'Self Publish', 'facebook.com/henrymuguluma1', 'East-African', '2022-07-20 13:26:11', 'henrymuguluma@gmail.com', 'Author', '', '', NULL, NULL),
(8, 'authors/Sarah_Eyaa.jpg', 'Sarah', 'Eyaa', 'eyaalydia@gmail.com', '+61470532551', '1981-01-18', 'Australia', 'English', 'Children - African Non-fiction', 'Dr. Sarah Eyaa was born and brought up in Uganda and has lived in Australia since 2012. Sarah is married to Julius, and they have two children, Shaun and Shvyonne. Professionally, Sarah is an academic and has taught at tertiary level in Uganda and Australia. Sarah is passionate about academia, writing, teaching and the preservation of local languages and culture. These passions have been integrated by writing children’s books and developing related educational merchandise, with the goal of introducing children to local languages from Uganda and the African value or cultural system, so that they are conscious of their cultural identity and can be confident of who they are.', '$2y$10$Tb3hS9IGLQzM3S9N5T0AXOHtCRd7edkzvfLG1E1gMrhdu.UkS/AG.', 'Self Publish', NULL, 'East-African', '2022-07-20 14:43:34', 'eyaalydia@gmail.com', 'Author', '', '', NULL, NULL),
(9, 'authors/Jennifer_Mudondo.jpg', 'Jennifer', 'Mudondo', 'jennifer.mudondo@gmail.com', '+256772833497', '1976-11-27', 'Uganda', 'English', 'Parenting & Family', 'I believe life is a mission for which I will account. I therefore commit to growing my own and those of the people around me.', '$2y$10$iGqaHnR.n2KA1b4PrY0BmegUajr8ASpDZ3GCourNogFunttfs9t4O', 'Self Publish', NULL, 'East-African', '2022-07-20 15:18:51', 'jennifer.mudondo@gmail.com', 'Author', '', '', NULL, NULL),
(10, 'authors/Ivan_Mawanda.jpg', 'Ivan', 'Mawanda', 'mawanda351@gmail.com', '+256 752 942434', '1986-07-04', 'Uganda', 'English', 'Self Improvement', 'Think You Can emphasizes your progress beyond imagination, aggressive but dignified yet frank-filled in nature, this is a noble tool to build and encourage the voice of reason with every opportunity that avails itself so that you can have an excellent tale ending. Life is what our thoughts make it, what we today is a result of what we think; thoughts are the building blocks of life.Just as physical exercise increases your chances for health, mental exercise increases your chance for wealth. Your ability to think long term is a developed skill. As you get better at it, you become more able to predict with increasing  accuracy what is likely to happen to you in the future as a result of your actions in the present. This is a quality of a superior thinker.So, what’s the best way to exercise your mind? Personal development, here’s a terrific offer: a no-obligation coaching consultation to see how coaching can help create the life of abundance you’re seeking.', '$2y$10$H0kUx9Haln3y6ZSeeHGfHOtUpeS26tLKzy3uysw7/r2oy30Gh8AKq', 'Self Publish', 'www.ivanmawanda.com', 'East-African', '2022-07-20 16:18:28', 'mawanda351@gmail.com', 'Author', '', '', NULL, NULL),
(11, 'authors/Andrew_Ssaazi.jpg', 'Andrew', 'Ssaazi', 'andrewssaazi@gmail.com', '+256 779 132688', '1989-10-31', 'Uganda', 'English', 'Motivational / Inspirational', 'Mr. Andrew Ssaazi is the Managing Director of SSAZMARG CONSULTANCY LTD. A consultancy firm in Kampala, which also doubles as an employment agency.\r\nHe is an Author, Productivity & Life coach working with Companies, Organizations, Government parastatals, Individuals, Higher Institutions of Learning and Schools to boost staff / individual productivity, and students’ focus.\r\nAs a Keynote speaker and seminar leader, he addresses many people in different industries, on different areas of life. In addition, Andrew has studied, researched, written and spoken in the fields of business, philosophy and Life. \r\nCoach Andy, as popularly known, has published two self-help books on personal and professional development; \r\n1.	The Homework of Potential Greatness, and \r\n2.	Confident Mind.\r\nCoach Andy speaks to higher institutions of learning, corporate and public audiences on the subjects of Productivity, Personal and Professional Development, including managers, executives and staff of many companies in Uganda. His exciting talks and seminars on Leadership, Selling, Self-Esteem, Goals, Strategy, Imagination, Creativity and Success Psychology bring about immediate changes and long-term results.', '$2y$10$Jm2LruAl0FOWR/Dw6BCWPOBI7VWNKb4wZ38gbIZJmEDSiGPTlX0KO', 'Self Publish', 'www.ssazmargconsultancy.com', 'East-African', '2022-07-20 16:31:48', 'andrewssaazi@gmail.com', 'Author', '', '', NULL, NULL),
(12, 'authors/Patricia_Khayongo_Rutiba.jpg', 'Patricia Khayongo', 'Rutiba', 'patriciakrutiba@gmail.com', '+256 740 594991', '1975-11-08', 'Uganda', 'English', 'African Fiction & Novels', 'Patricia is an author and architect. She has been married to Daniel Rutiba for 22 years and together they have three children; Gideon (19), Michael (17) and Kyla (14).  Patricia and her husband are dedicated to serving at their church, through its SWAP ministry (Singles With A Purpose). Patricia loves a good novel and enjoys writing novels that teach culture, history and morals through her uniquely African perspective.', '$2y$10$7rH/LRSDzMCM3bqgPljMmeG6G4e3VvuDTk46piasR0WILw7inQLKO', 'Self Publish', NULL, 'East-African', '2022-07-20 18:31:16', 'patriciakrutiba@gmail.com', 'Author', '', '', NULL, NULL),
(13, 'authors/Mabel_Sebikari_Magezi.jpg', 'Mabel Sebikari', 'Magezi', 'msebikari@yahoo.com', '+256 772 887888', '1975-09-11', 'Uganda', 'English', 'Law & Advocacy', 'Mabel Sebikari Magezi is a health and safety professional who investigates work and traffic related accidents within Uganda, E. Africa. She is passionate about people and writes from her real life experiences with victims and survivors in an effort to bring transformation to the safety culture in Uganda.', '$2y$10$6AunvZc9o.V.gqYSOZI5pu39pBCjj/5ouldtkadxHsPAIt1aa78L.', 'Self Publish', NULL, 'East-African', '2022-07-21 02:01:15', 'msebikari@yahoo.com', 'Author', '', '', NULL, NULL),
(14, 'authors/Hilda_Ocan.jpg', 'Hilda', 'Ocan', 'hildaocan@gmail.com', '+256 772 411856', '1972-07-09', 'Uganda', 'English', 'African Life', 'Hilda Ocan is a wife, mother, mentor, and nutritionist living in Kampala, Uganda. A graduate of Sokoine University of Agriculture in Tanzania, Hilda loves supporting initiatives that contribute to developing women of all ages; spiritually, socially, and economically. It is her passion for women and girls that inspired Hilda to publish her debut book, Letters To My Daughter which tackles important topics on relationships, ministry, growing up, God and much more.', '$2y$10$idEAeWJ7dYofPIa7.pdN3emETGAwFTZ3n567Zdq34sCb4Zgbyu33.', 'Self Publish', NULL, 'East-African', '2022-07-21 02:16:55', 'hildaocan@gmail.com', 'Author', '', '', NULL, NULL),
(15, 'authors/Bernice_Muwonge.jpg', 'Bernice', 'Muwonge', 'mbernice7a2020@gmail.com', '+256 787 119255', '2007-09-02', 'Uganda', 'English', 'Young Adults - African Non-fiction', 'Bernice is a young and upcoming author. Currently in High School (Secondary School) Bernice enjoys writing short stories and poems that captivate and engage her readers, often including surprise ends or unexpected plot twists. She is the eldest of four siblings and is truly an example of what the next generation of African authors looks like.', '$2y$10$DQvV6zIkC4mb4IgG2zlTC.MRiPWlOZPqrxvMnV/Tr7g4KhPDsxKFW', 'Self Publish', 'https://', 'East-African', '2022-07-21 11:59:38', 'mbernice7a2020@gmail.com', 'Author', '', '', NULL, NULL),
(16, 'authors/Lena_Mirembe_Pira.jpg', 'Lena Mirembe', 'Pira', 'lpira@newinternational.org', '+256783701051', '1980-12-05', 'Uganda', 'English', 'Christian Living', 'Lena Mirembe Pira is an author, editor and publisher. Originally from California, Lena has lived the majority of her adult life in Africa. She writes not only professionally but personally from her life and experiences as a full time missionary in Uganda.', '$2y$10$PyAvh/PJlUb5GkDS1x.gX.Sev3QN7f4wiBBgqlkebKcm2BhJYU/2.', 'publishingagreements/Lena_Mirembe_Pira.pdf', NULL, 'East-African', '2022-07-21 12:38:48', 'info@leappublishers.com', 'Publisher', '', '', NULL, NULL),
(17, 'authors/Paul_Obafe.jpg', 'Paul', 'Obafe', 'obafe.paul@gmail.com', '+44 7401 151805', '1967-01-15', 'Nigeria', 'English', 'Fictional Biography / Autobiography', 'My name is Paul Obafe. And I am not normal. My life went into a tailspin a few years ago. It was like a tornado ripped through the land of my life. By the time its fury was expended, there was a solemn quiet. And with it was the aftermath of destruction. Ruin.\r\nSo where do I go from here? To the right, where nothing is left? Or to the left where nothing is right? It is from these experiences that I took pen to paper and started the journey of sharing my musings with the world. As any not-normal person would have it, I created my own genre of writing, I affectionally call it \'Ficto-Biography.\' Journey with me through my muses and draw your own conclusions on this thing we call life.', '$2y$10$tTE6Fn2lMik0KggvVR3ffuulv6wSvPKIbQRWqLipqjmpKVHv6i4te', 'Self Publish', NULL, 'West-African', '2022-07-21 13:17:19', 'obafe.paul@gmail.com', 'Author', '', '', NULL, NULL),
(18, 'authors/Lukas_Pious_Lukanga.jpg', 'Lukas Pious', 'Lukanga', 'lukaspious@gmail.com', '+256 702 280363', '1992-03-09', 'Uganda', 'English', 'Christian Living', 'Lukas Pious Lukanga is the premier evangelist and inspiration to the youth of Africa. A gifted apostolic voice to the nations reigniting the Spirit of greatness in the generation. He is a fearless prolific writer and speaker, transformational thought leader and Team Lead Transition Minds. He is passionate about awakening and empowering ordinary people to become extra ordinary influence in their society and His books and messages continue to activate millions into the destiny the Lord God has predestined for their lives through a renewed perspective.', '$2y$10$ZQJjM8Mv4ZZUD.LiI6ay7..ASe75V1wmRDv1uE3mQmywR5spvwDx6', 'Self Publish', 'https://https://', 'Central-African', '2022-07-22 09:14:41', 'lukaspious@gmail.com', 'Author', '', '', NULL, NULL),
(19, 'authors/RICHARD_MWEBESA.jpg', 'Richard', 'Mwebesa', 'richardmwebesa707@gmail.com', '+256 776 712962', '1983-04-09', 'Uganda', 'English', 'Self Improvement', 'Richard Mwebesa is a voice of inspiration, a life coach and marketing and business development consultant, a motivation mechanic, and poet. He is the Author of the Life transforming book entitled: Out   of the Crowd - The Ultimate guide to mastering the art of standing out and Inspired by Forty Books. He is a Certified Business Professional Master Executive, holds an MBA and is a seasoned marketing, business development and sales professional with vast experience in those fields. He currently works with a leading diversified financial services group in East and Central Africa. He has worked with leading brands in Uganda in the Insurance and Technology space and does consultancy work with the Insurance Training College of Uganda (ITC). He is passionate about helping others find and define their why in life and purpose, developing systems and unlocking potential within others.', '$2y$10$EC7GRb3LZaEPxAAYcB4RHODX5VaXvz/bx8nrA2fDz6AehvUDUS/2u', 'Self Publish', 'www.mwebesabooks.com', 'East-African', '2022-07-22 13:44:58', 'richardmwebesa707@gmail.com', 'Author', '', '', NULL, NULL),
(20, 'authors/Bryana_Muwonge.jpg', 'Bryana', 'Muwonge', 'bryanamuwonge@gmail.com', '+256 782 115800', '2008-10-01', 'Uganda', 'English', 'Short Stories & Fables', 'Bryana is a young and upcoming author and illustrator who enjoys crafting short stories and poems with visual sketches to draw in her readers. At only 14 years of age, Bryana is one of AfricanBooks.com\'s youngest writers and an inspiration to many. Proof that you can do and be anything that you set your mind to!', '$2y$10$ZQ7ibakepxHpGshe4IzDh.3OiAPGKyDCPdT6fEdv3xIZgYZ4DfLbm', 'Self Publish', NULL, 'East-African', '2022-07-22 16:30:43', 'bryanamuwonge@gmail.com', 'Author', '', '', NULL, NULL),
