(22, 'authors/Apollo_Kaggwa.jpg', 'Apollo', 'Kaggwa', 'apollocway@gmail.com', '+256 782 949530', '1981-08-28', 'Uganda', 'English', 'Christian Living', 'Apollo is the founder and lead pastor of Christ Way Mission/Church in Uganda. He is also a husband, father, counsellor, author, public speaker, stand-up comedian and all around good guy! Apollo uses his life experiences and faith as a platform for writing. He loves to encourage people to be all they can be.', '$2y$10$bEx25GJq9sEOx1zDw/deaeOSI0vEQ34D4yanx5qNi4plb4sfUGlZS', 'Self Publish', NULL, 'East-African', '2022-07-22 16:40:04', 'apollocway@gmail.com', 'Author', '', '', NULL, NULL),
