(29, 'authors/Sarah_Sseggane.jpg', 'Sarah', 'Sseggane', 'sarasseggane@gmail.com', '+256752416160/+256772416160', '1972-01-07', 'Uganda', 'English', 'Christian Living', 'I am a lover of Jesus, wife, pastor, nurturerer and coach. I am passionate about helping people breakthrough obstacles to living their God given purpose and full potential in God.', '$2y$10$Oc4A.z6E7vJkpa./E8h63.JYn9QiLkTO2o/LJLttooH9gu209c/u6', 'Self Publish', 'N/A', 'East-African', '2022-08-01 10:38:31', 'sarasseggane@gmail.com', 'Author', '', '', NULL, NULL),
(30, 'authors/Marjorie_Kasozi_Sseruwo.jpg', 'Marjorie Kasozi', 'Sseruwo', 'marjorie.kasozi@gmail.com', '+256 786 884269', '1978-08-30', 'Uganda', 'English', 'Christian Living', 'Marjorie Marjorie Kasozi Sseruwo is passionate about strong families and communities. She lives to edify and uplift the broken hearted through song and behavioral change communication. She helps young people to espouse character and sound judgment to make day to day choices that will enable them to persevere in life. She also loves to worship the Lord in song.  Marjorie is the Executive Director at Concern for the Girl Child and an Associate Director at FHK Foundation, both family founded organizations. She is a wife to Mulungi Sseruwo, a mother to Tinashe Kirabo, and together they live in Kampala, Uganda.', '$2y$10$Iqb7Vqromxulkk2HmoRiE.QCsl7g7HpVYTsMt7DzRGtgpxXkcKVVa', 'Self Publish', NULL, 'East-African', '2022-08-02 19:59:46', 'marjorie.kasozi@gmail.com', 'Author', '', '', NULL, NULL),
(31, 'authors/Stephen_Orukpe.jpg', 'Stephen', 'Orukpe', 'paajiafrica8@gmail.com', '08029467893', '1980-08-18', 'Nigeria', 'English', 'Literary Fiction', 'I am a prolific writer primarily of the legal profession who has successfully traversed novel areas in writing such as literary fiction, Educational, Inspiration, Motivational and Entrepreneurship.\r\nCurrently has published 15 books spanning different genres.\r\nHe believes in Jack Ma philosophy of today is bad, tomorrow is worse and the day after will be better and that easier is better availability is key.', '$2y$10$0blrVMIB5zJ8h1Pzj1h7J.K.CnMs/Oyig72OlfMseaupHc1FRRsAO', 'Self Publish', 'www.facebook.com/Orukpe Stephen 1', 'West-African', '2022-08-07 12:12:14', 'paajiafrica8@gmail.com', 'Author', '', '', NULL, NULL),
(32, 'authors/Ojeele_Joseph_Samuel.jpg', 'Ojeele', 'Joseph Samuel', 'ojeelesam@gmail.com', '778814411', '1992-04-20', 'Uganda', 'English', 'Christian Living', 'Ojeele Joseph Samuel is a Telecommunications technician, Bible teacher, an Intercessor and a mission coordinator at St. Mark C.O.U. Jinja-Misindye Mukono Diocese. He also works with Rainbow Garden Intercession Ministries as a support staff, a prayer and intercession ministry in Uganda that organizes annual national conferences (Feast of Esther, Prophetic Prayer Conference, AWOBA) to pray for nations, the body of Christ, families, and individuals. He is married to  Nachuka Racheal Ojeele. By the grace of God, he is called to cleanse the body of Christ and prepare God’s people to build an intimate relationship with the Lord in these perilous days. ', '$2y$10$a5eKIGAtGxcTs44l9qTese/HOo1OtZiHEhry2/MWTs5Xw.FBoXN0m', 'Self Publish', NULL, 'East-African', '2022-08-18 22:40:49', 'ojeelesam@gmail.com', 'Author', '', '', NULL, NULL),
(33, 'authors/Bruno_Edgard.jpg', 'Bruno', 'Edgard', 'tpkbruno@gmail.com', '+256787551356', '1994-05-04', 'Uganda', 'English', 'Poetry', 'Bruno Edgard aka Edgard The Bard is a lawyer by profession and a storyteller by practice; he is an author, poet, actor, screenwriter, playwright, producer, and media personality. A passionate man with a golden pen and a silver tongue, Edgard The Bard has authored a poetry anthology entitled One Last Smoke. His performing prowess is exhibited by his ability to perform using the spoken word format and the more technical theatrical style.', '$2y$10$u637yrVhdIJhUmRXqscO9OVb9oLvPoaH0jb58cNBC5WFef4tk9J.6', 'Self Publish', NULL, 'East-African', '2022-09-07 14:15:08', 'tpkbruno@gmail.com', 'Author', '', '', NULL, NULL),
(34, 'authors/Timazi_Africa.jpg', 'Timazi', 'Africa', 'info@timazi.org', '+254 705 182141', '2000-01-01', 'Kenya', 'English', 'Christian Living', 'Timazi, Africa\'s largest teen Christian magazine, is published in Kenya with the goal\r\nof helping young people know their faith, love it, and defend it while responding to\r\ncontemporary issues of the day.', '$2y$10$33.FfbwltsTGu6suTC8rmOYQle2vzJ5kKCszPRTlLXQSQjz8OwKQi', 'Self Publish', 'www.timazi.org', 'East-African', '2022-09-09 15:23:46', 'info@timazi.org', 'Author', '', '', NULL, NULL),
(35, 'authors/Mbabazi_Charlotte.jpg', 'Mbabazi', 'Charlotte', 'mbabazicharlotte70@gmail.com', '+25677258910', '1963-12-14', 'Uganda', 'Select', 'African Biographies & Memoirs', 'Charlotte Mbabazi is a business owner, life coach, administrator, social philanthropist and author. Her mission is to inspire and mentor young people into exploring their full potential through Biblical principles. She is also passionate about supporting widows and orphans by offering them emotional and psychosocial support.', '$2y$10$mt5Cb7903SCzv7fCsY39jO3QM2HECkfJ9taidfOPQqFUvxBZXIIXe', 'Self Publish', NULL, 'East-African', '2022-09-14 10:38:11', 'mbabazicharlotte70@gmail.com', 'Author', '', '', NULL, NULL),
(36, 'authors/Erivania_Manuela_Janet_Ikonyu.jpg', 'Erivania Manuela', 'Janet Ikonyu', 'erivaniamanuela3@gmail.com', '+256772662506', '2012-07-12', 'Uganda', 'English (Britain)', 'Young Adults - Popular Fiction', 'Erivania Manuela Janet Ikonyu is a 9-year-old girl in primary four. She has developed herself into writing children\'s story books. Most of Erivania\'s stories embark on real-life scenarios and fiction. This makes her an interesting author anyone would be interested in. Erivania is followed by a baby brother Kedi Mephi, both hailing from a humble family of Mr. and Mrs. Paul Owera living in Entebbe Municipality - Uganda.', '$2y$10$2thO5MXS8FqzKEpzXXrFAu2qIf5JfON.kJeoweis/U9wAedWwCvga', 'Self Publish', NULL, 'East-African', '2022-09-20 12:45:16', 'erivaniamanuela3@gmail.com', 'Author', '', '', NULL, NULL),
(37, 'authors/Henry_Annan.jpg', 'Henry', 'Annan', 'unlimited.caregiver@gmail.com', '024 386 2890', '1974-08-28', 'Ghana', 'English (Britain)', 'Christian Living', 'Worshipper|| Pastor|| Ministry Life Coach|| Writer', '$2y$10$IwYlvpHg53sODYITdxyfU./es/0i65FU13mQtTl5pXMNzo1oiL88y', 'Self Publish', 'www.carelinkfoundationgh.com', 'West-African', '2022-09-25 01:59:23', 'unlimited.caregiver@gmail.com', 'Author', '', '', NULL, NULL),
(38, 'authors/Suzan_Adong.jpg', 'Suzan', 'Adong', 'suzanadong@gmail.com', '+256701502409', '1972-09-08', 'Uganda', 'English (Britain)', 'Parenting & Family', 'Suzan Adong is the author of Understanding Teens: A Parent\'s Persepective, her 1st publication.  She has a wide experience in various aspects of communications like radio broadcasting, interpretation, translation, writing, editing, website & intranet administration, among others. She loves to design graphics, and to be creative with handicrafts. She blogs at www.suzana2020.wordpress.com, enjoys cookery and doing fitness routines. Engaging in community work is one of her passions and she is a strong believer in God.', '$2y$10$yV.s7tZg2YN0Jxgwa06UIemWIKCbWmgBapU8VEFavBTK10HocTZCK', 'Self Publish', NULL, 'East-African', '2022-09-26 14:38:22', 'suzanadong@gmail.com', 'Author', '', '', NULL, NULL),
