INSERT INTO `books` (`ID`, `BookID`, `BookTitle`, `BookSubtitle`, `BookAuthor`, `BookGenre`, `BookEdition`, `BookSeries`, `BookRegion`, `PaymentPlan`, `BookCurrency`, `BookPrice`, `BookEarning`, `AuthorEarning`, `PublisherEarning`, `BookFile`, `BookUpload`, `PreSignedURL`, `BookCover`, `BookFormat`, `BookPages`, `BookVolume`, `BookChapters`, `BookLanguage`, `BookKeywords`, `BookISBN`, `BookEditor`, `BookIllustrator`, `BookPublisher`, `CoAuthor`, `BookPreview`, `AdditionalContributors`, `BookSynopsis`, `PublishingRights`, `AfricanBooksEarning`, `BookSampler`, `BookTableofContents`, `BookProducer`, `BookNarrator`, `BookStatus`, `ReviewStatus`, `ReviewRemarks`, `BookTranslator`, `YearofPublication`, `DateTimeAdded`, `AddedBy`, `AddedByRole`) VALUES
(2, 'AB188', 'Conquering Mountains!', 'Day By Day With Jesus Devotional', 'Martin Lwanga', 'Bible Study & Devotionals', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '5.49', '3.02', NULL, NULL, NULL, 'eyJpdiI6Ii9nR0xENzRybzhjbWFkVDQ0WEh3Z3c9PSIsInZhbHVlIjoiOFJVZHRZMDN2WFdTSFZHd2JOeU8rbnBrMXZkNTdxYnpMZFN2NVJjU3p5MDdGVmNpSXNORmZVSDVOd3pDT1dtZDQ1TmhlTG9RdSs4SUhRVzR5eGpWeWc9PSIsIm1hYyI6ImY5NmZjYzI1MTY3Yzg2MTRjMDljOTE1NzVhOGQ2YTgzMzVhOWRkNjQ1NzlkOTJkN2MwMWQ3ZTJkNDUyNTU5ZmUiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Conquering_Mountains!_Martin_Lwanga.jpg', 'Ebook', '395', NULL, NULL, 'English', 'Daily, Devotional, Christian Living, Spiritual, Bible Study', '9789970784004', NULL, 'Karl Graphix Ltd', 'African Digital Christian Communications', NULL, 'bookpreviews/ebooks/Conquering-Mountains_Martin-Lwanga.epub', NULL, 'We can only know and fully experience the love of God by trusting Jesus. In His Word, there is wisdom, mercy, healing, answers and correction. Day by Day with Jesus is a 365-day, daily devotional book, published to help you in your spiritual journey by drawing from life’s experiences and unique situations. We hope and pray you will be inspired in your daily walk with the Lord Jesus Christ!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Martin Lwanga', 'Author'),
(3, 'AB881', 'Everyone Can Be An Effective Manager', 'How To Improve Your Managerial Skills Through African Case Studies', 'Martin Lwanga', 'Business & Management', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '5.49', '3.02', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Everyone_Can_Be_An_Effective_Manager_Martin_Lwanga.jpg', 'Ebook', '294', NULL, NULL, 'English', 'Management, Manager, Africa, Business Skills', '9789970221027', NULL, 'Esso Graphix Ltd.', 'Everyone Publishers Ltd', NULL, 'bookpreviews/ebooks/Everyone-Can-Be-An-Effective-Manager_Martin-Lwanga.epub', NULL, 'Everyone who lives will be affected by a Manager somewhere. Indeed, all of us, right from birth are exposed to managers in our families. As our parents go about planning for our lives and organizing the resources to take us from infancy to adulthood, they play various management roles. They provide leadership and control resources to ensure stability. It is little wonder that very often we observe some homes are better managed than others. Improving our skills as Managers would therefore benefit every one of us, whether it is in the home, at work, in our companies or in our social circles. Learn valuable managerial lessons from the African context with Business and Management expert, Dr. Martin Lwanga.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2013', '0000-00-00 00:00:00', 'Martin Lwanga', 'Author'),
(4, 'AB357', 'Everyone Can Get A Job!', 'The Complete Guide For Job-Seekers On How to Look For & Get A Job', 'Martin Lwanga', 'Self Improvement', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '4.15', '2.91', NULL, NULL, NULL, 'eyJpdiI6IlowbWlpT2JjOXpjODRId0M4SDRqb3c9PSIsInZhbHVlIjoiREhkYmIvWThOdzVLb1c1UWpnaS9KWDdablIrL1pNNnVYWTBNRi9sa0tYNmpyZlNZMEVEVElLQ2FoQnBiaWxqZ0E2RENQQ0lTV3VlUXNnTSt2QmQrY1E9PSIsIm1hYyI6IjMzMzhiMjg3ODM1NGU3Mzk3ODljZWM5NDgxZDhmNWM3NDMxNGJiMjEwZjgyMDI4MWU2NGY4ZDI5NzIyMTk4ODEiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Everyone_Can_Get_A_Job!_Martin_Lwanga.jpg', 'Ebook', '112', NULL, NULL, 'English', 'Job, Employment, Personal Development, Skills, How To', '9789970784011', NULL, 'Karl Graphix Ltd', 'Everyone Publishers Ltd', NULL, 'bookpreviews/ebooks/Everyone-Can-Get-A-Job_Martin-Lwanga.epub', NULL, 'Perhaps, more than ever before, searching for and getting a job has become increasingly difficult. According to the National Council for\r\nHigher Education (NCHE) in Uganda there are over 40,000 students graduating from universities and tertiary institutions every year but just above 13,000 are able to find formal employment. As more and more graduates enter the work field job hunting skills are going to be all the more critical. It is not going to be enough to have a degree, diploma or certificate but one needs the skills that result in employment. In this book, Dr. Martin Lwanga will teach you his tried and true methods for acquiring and keeping a job. An expert in business and management, he shares his knowledge of what employers are looking for and how you can best position yourself for success. Don\'t sit around waiting for that job to come, go out and do something now!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2018', '0000-00-00 00:00:00', 'Martin Lwanga', 'Author'),
(5, 'AB873', 'Everyone Can Have A Successful Career', 'The Complete A-Z Guide On How To Choose The Right Career', 'Martin Lwanga', 'Self Improvement', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '5.29', '2.91', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Everyone_Can_Have_A_Successful_Career_Martin_Lwanga.jpg', 'Ebook', '337', NULL, NULL, 'English', 'Career, Work, Success, Personal Development', '9789970900718', NULL, NULL, 'Everyone Publishers Ltd', NULL, 'bookpreviews/ebooks/Everyone-Can-Have-A-Successful-Career_Martin-Lwanga.epub', NULL, 'Today, more than ever before, hundreds of thousands of students upon graduation are entering the workplace without an idea of what to do based on their skills, interest, values, aptitude and available job opportunities. The lack of career guidance makes many of them choose courses in which they have no interest and, predictably, do underperform when they could easily have excelled in some other course. Many others soon after graduation wonder why they wasted all their time in school. To succeed in life, choosing the right career path to invest in will go a long way in determining how successful one ends up. Spend time with business expert, Dr. Lwanga, as he walks you through career options and paths applicable in today\'s world.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2013', '0000-00-00 00:00:00', 'Martin Lwanga', 'Author'),
(6, 'AB604', 'Everyone Can Sell!', 'The Little Confessional Book of Highly Effective Sales Persons', 'Martin Lwanga', 'Self Improvement', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '4.99', '2.74', NULL, NULL, NULL, 'eyJpdiI6IlUwTFVZTDQ3TXNOaTlDTkNHdmJ3K3c9PSIsInZhbHVlIjoiSndQNEVPTFIrcDI2N25tUkRCc0FqYVlUZ1Q3S2p4ZVNrcDd0Y3Yza0JGODBUd0QxOGx1dHgyT0NPN1dnMmJjbHpDN2x3Mk5zbjBNZ1NTY1E0VEVHQ0E9PSIsIm1hYyI6IjVhYTdhYzY0MjViZDNhM2E3MTBhNjM1NDYwMjk3Mzg2MzJmNDg1MzIwNDI3MWE5MDJmZDM3YWQ5NzVlY2ZjOWUiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Everyone_Can_Sell!_Martin_Lwanga.jpg', 'Ebook', '124', NULL, NULL, 'English', 'Sales, Business, How To, Sell, Marketing', '9789970784035', NULL, 'Karl Graphix Ltd', 'Everyone Press Ltd.', NULL, 'bookpreviews/ebooks/Everyone-Can-Sell_Martin-Lwanga.epub', NULL, 'Sales are one of the most pervasive and enduring occupations around the world, going back to the beginnings of humankind’s\r\ncivilization. Every person who makes any progress in any profession must first learn to sell. To get a job, you must sell yourself to the\r\ncompany you aspire to work for. Successful lawyers are everyday selling themselves before judges and clients. The famous dentist must\r\nsell his art to the patient. The rousing preacher must sell his sermon to the parishioners. The enterprising head teacher of any promising\r\nschool must sell herself to both the students and parents to keep her job. To be successful, the Chief Executive Officer of any nation, whether\r\nPresident or Prime minister, must sell his vision to the citizenry and sometimes, to the world. This is exactly what Nelson Mandela did for\r\nSouth Africa and brought the World Cup to the continent. This book is not just written for the hired door-to-door salesperson or\r\nyour infamous car-lot salesman. It isn’t for the medicine seller, blowing the trumpet down the road juncture, with ‘cures’ for all manner of\r\nailments. Rather, it is for everyone interested in having a successful life. If you take the time to master the time-tested secrets herein, you will surely be on the way to achieving whatever you desire.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2009', '0000-00-00 00:00:00', 'Martin Lwanga', 'Author'),
(7, 'AB791', 'Everyone Can Win Office Politics!', 'The Complete Guide On How To Survive & Succeed In Organizations', 'Martin Lwanga', 'Business & Management', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '4.99', '2.74', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Everyone_Can_Win_Office_Politics!_Martin_Lwanga.jpg', 'Ebook', '148', NULL, NULL, 'English', 'Office Politics, Organizations, Success Principles, Job, Employment', '9789970784004', NULL, NULL, 'Everyone Publishers Ltd', NULL, 'bookpreviews/ebooks/Everyone-Can-Win-Office-Politics_Martin-Lwanga.epub', NULL, 'Everyone Can Win Office Politics has been written as an everyday guide for the organizational worker who wants to get on with his job, play his part, survive, succeed and at the right time exit. These rules may not apply in every situation but the essence is the same: life is about\r\nsurvival and with most things, there are principles that matter. Join business expert, Dr. Lwanga, as he teaches you five key rules of Office Politics so that you can not only succeed but thrive in your workplace!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2013', '0000-00-00 00:00:00', 'Martin Lwanga', 'Author'),
