(20, 'AB211', 'Why Did I Die?', 'A Case For Road Traffic Accident Victims', 'Mabel Sebikari Magezi', 'Law & Advocacy', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '4.15', '2.91', NULL, NULL, NULL, 'eyJpdiI6Ii9pUml3aWtHS01HYmplNlpFbEF1QlE9PSIsInZhbHVlIjoibFJxUWJES1dNVVVuN2dycXFRR2pML1M0cnFZbkV4OFFyVmVCN2RybHNpWTdRU21zbEdXM0FkTUk1UW1PN1crL1NZRjhtR21VT3R3SFFvendaTjJCeVE9PSIsIm1hYyI6ImY3Nzc1OTUyNDE4YjI2YmY0ZDNlYjgyNTFkZDUzYTY3N2E2ODRmZTI0NjVlZTBkODllNmI2MTRmMTlmMGZiOGYiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Why-Did-I-Die_Mabel-Sebikari-Magezi.jpg', 'Ebook', '182', NULL, NULL, 'English', 'Traffic Accidents, Premature death, trauma, car accidents, death, safety', '97899136100302', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Why-Did-I-Die_Mabel-Sebikari-Magezi.epub', NULL, 'There is a time to live and a time to DIE...\r\nWhile we might not like to talk about it, death becomes us all. Some live long lives and die very peaceful deaths, while others experience a more traumatic ending. This book tells the stories of real life people who died before their time as a result of road traffic accidents. While their deaths are unfortunate, we seek to learn from their stories so that we may save others from the same sad fate.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2021', '0000-00-00 00:00:00', 'Mabel Sebikari Magezi', 'Author');
