(21, 'AB605', 'Gustavus Vassa, The African', NULL, 'Olaudah Equiano', 'African Biographies & Memoirs', NULL, NULL, 'West-African', 'Ujamaa (Wealth Building Plan - 55%+15%) $2 to $4.15', '$', '4.15', '2.91', '2.28', '0.62', NULL, '', '', 'bookcovers/ebooks/Gustavus_Vassa,_The_African_Olaudah Equiano.jpg', 'Ebook', '334', NULL, NULL, 'English', 'Slavery, African History, Nigeria, Abolitionists, Memoir', '9780998856940', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Gustavus-Vassa-The-African_OlaudahEquiano.epub', NULL, 'Picture it: Africa 1745. Born in West Africa, join Olaudah Equiano on his autobiographical journey from boyhood to freedom fighter on a journey around the world by sea. Experience his life as he is transformed from Olaudah to Gustavas Vassa through this first-hand account of kidnapping, slavery, salvation, freedom and advocacy unlike any you have heard before. Olaudah will always be remembered as a voice in the darkness crying for freedom for all! Written in London, in 1789, this is a historical classic you won’t be able to put down.', 'This is a public domain work', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Leap Publishers', 'Publisher'),
(22, 'AB405', 'African Play Collection', 'Four Short Playscripts', 'Zora Neale Hurston', 'Dramas & Screenplays', NULL, NULL, 'African-American', 'Ujamaa (Wealth Building Plan - 55%+15%) $2 to $4.15', '$', '3.79', '2.65', '2.08', '0.57', NULL, '', '', 'bookcovers/ebooks/African_Play_Collection_Zora_Neale Hurston.jpg', 'Ebook', '56', NULL, NULL, 'African American English (AAE)', 'Plays, Scripts, African American Culture, Screenplays', '9780998856957', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/African-Play-Collection_Zora-NealeHurston.epub', NULL, 'Travel back to Black America in 1931 with playwright Zora Neale Hurston with this unique\r\ncollection of four short plays, including:\r\n- Lawing & Jawing\r\n- Forty Yards\r\n- Woofing\r\n- Poker!\r\nWhether it be a courtroom or a game room. This collection of witty plays will keep you entertained from beginning to end.', 'This is a public domain work', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Leap Publishers', 'Publisher'),
(23, 'AB858', 'The Autobiography of an Ex-Colored Man', '110th Anniversary Edition', 'James Weldon Johnson', 'Fictional Biography / Autobiography', NULL, NULL, 'African-American', 'Ujamaa (Wealth Building Plan - 55%+15%) $2 to $4.15', '$', '3.89', '2.72', '2.14', '0.58', NULL, '', '', 'bookcovers/ebooks/The_Autobiography_of_an_Ex-Colored_Man_James_Weldon Johnson.jpg', 'Ebook', '198', NULL, NULL, 'English', 'African American History, Classic Books, Bi-Racial, Black Lives Matter', '9780998856964', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/The-Autobiography-of-an-Ex-Colored-Man_James-WeldonJohnson.epub', NULL, 'From ATLANTA to NEW YORK, PARIS to LONDON... Join in this 1912 fictional tale of a man discovering who he is in and where he belongs. Delving into topics on race, equality, relationships and much more, this story takes twists and turns, ups and downs as a young bi-racial boy grows into a self-proclaimed white man.', 'This is a public domain work', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Leap Publishers', 'Publisher'),
(24, 'AB242', 'Muses Of An Angry African Man', NULL, 'Paul Obafe', 'Fictional Biography / Autobiography', NULL, NULL, 'West-African', 'Umoja (Unity Plan - 45%) $5.50 to $6', '$', '5.99', '2.70', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Muses-Of-An-Angry-African-Man_Paul-Obafe.jpg', 'Ebook', '279', NULL, NULL, 'English', 'African, Muses, Life, Love, Short Stories, Ficto-Biography', '9798637801626', NULL, NULL, NULL, NULL, 'bookpreviews/ebooks/Muses-Of-An-Angry-African-Man_Paul-Obafe.epub', NULL, 'Paul Obafe invites you on a journey through his experiences in life in Muses of An Angry African Man. With an unusual and varied writing style, he shares his thoughts on Life, Love, Living, Culture, Struggles, Failure, Recovery and Success within a new genre he aptly refers to as ficto-biography. His perspectives are not only refreshing but motivational and inspirational in a form that can be identified with, leaving you with a memorable after taste. He shares life\'s tools for survival based on his experience touching on topics as religion, entrepreneurship, history and African culture. Each muse makes up a chapter in the book that can be read independently but yet with a theme weaving them all together, leaving you with a diverse after taste. Welcome to the Muses of this angry African man.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2020', '0000-00-00 00:00:00', 'Paul Obafe', 'Author'),
(25, 'AB484', 'Persistence Pays Off', 'Lessons on Life, Faith, Purpose and Everyday Living From An African Dreamer', 'Lukas Pious Lukanga', 'Christian Living', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '4.00', '2.80', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/PERSISTENCE-PAYS-OFF_Lukas-Pious-Lukanga.jpg', 'Ebook', '132', NULL, NULL, 'English', 'Hard Situations, Life Lessons, Failure, Success, Dreams', '79781779213419', 'Beyond Today Publishers', 'Agix Creatives', 'Beyond Today Publishers', NULL, 'bookpreviews/ebooks/Persistence-Pays-Off_Lukas-Pious-Lukanga.epub', NULL, 'PERSISTENCE PAYS OFF is a heart to heart message that will help you realise that all the things that have happened or are happening in your life have significance. To understand this, takes intentional retrospection. It is only then that you can respect and appreciate the relevance these situations have in shaping your life purpose and the meaning of your existence. No matter what happens to you or around you, it is vital that you never give up. Stay persistent and great things will always lie ahead!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2020', '0000-00-00 00:00:00', 'Lukas Pious Lukanga', 'Author'),
(26, 'AB381', 'Inspired by Forty', 'Lifestyle, Love, Hope and Character Quotable quotes, Inspirational', 'RICHARD MWEBESA', 'Self Improvement', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '3.00', '2.10', NULL, NULL, NULL, 'eyJpdiI6IjVvVFhQaXh0cXNndklWSGY3MEsxV2c9PSIsInZhbHVlIjoiS3JTbWRLWEpmWW9tZ0c4UUVrc2t1eUd1RDllZ0xXNll6SDdGblk2Y3l3TXpncFdpblZIR1lNeFlYbW5TUDV4UXBRK0JUaGZCYk5BeVpDSWZqMHFKS0E9PSIsIm1hYyI6IjBjNTc1MWVlNmQzMDZhZTFiMmM2NTJlODIwYTA4MzNmMzA1YWY2YTEwYzBiZTRjOGE3MGViNGIzOTg4NzFmOTEiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Inspired-by-Forty_RICHARD-MWEBESA.jpg', 'Ebook', '32', NULL, NULL, 'Select', 'Lifestyle, Love, Hope and Character Quotable quotes, Inspirational', '9789970662050', NULL, NULL, NULL, NULL, 'bookpreviews/ebooks/Inspired-by-Forty_RICHARD-MWEBESA.epub', NULL, '\'Inspired by Forty,\' is a collection of quotable quotes that have been purposefully written and packed with wisdom nuggets to ignite a call to action in the reader. Words are powerful and the right ones do not only have the power to change lives but transform them. These words of wisdom will enable you build the foundation to have insightful guidelines that will enable you stay on the course you choose to take. We are the captains of our own lives. Like a ship’s radar the Inspired by forty quotable quotes shall enable the captains steer their lives in the direction they so choose. Easy to memorise, simple to refer to and resoundingly exciting they are. Read and find out for yourself. Welcome onto the ship of the insightful.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2020', '0000-00-00 00:00:00', 'RICHARD MWEBESA', 'Author'),
(27, 'AB621', 'Equip | Equipping Lifegroup Leaders To Lead Effectively (Mavuno Church Edition)', '10-Week Training Manual For Mavuno Lifegroup Leaders', 'Lena Mirembe Pira', 'Ministry & Evangelism', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '4.99', '2.74', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Equip--Equipping-Lifegroup-Leaders-To-Lead-Effectively-Mavuno-Church-Edition_Lena-Mirembe-Pira.jpg', 'Ebook', '130', NULL, NULL, 'English', 'Lifegroups, Small groups, small group leaders, leader training', '9780998856988', 'Lena Mirembe Pira', NULL, 'Leap Publishers', NULL, 'bookpreviews/ebooks/Equip--Equipping-Lifegroup-Leaders-To-Lead-Effectively-Mavuno-Church-Edition_Lena-Mirembe-Pira.epub', 'Mavuno Church', 'Lifegroups, otherwise known as small groups, are a vital part of Mavuno Church. This 10-week training handbook is a guide to help new and existing lifegroup leaders lead more effectively. Created specifically for Mavuno Church Leaders, this edition helps small group leaders to understand the expectations and vision of the church in which they are apart of. As leaders on a leadership journey, this guidebook will help bring you to the next level of leadership for the betterment of the people around you. It is time for you to step up and be the change you want to see in our communities for Christ!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2016', '0000-00-00 00:00:00', 'Lena Mirembe Pira', 'Author'),
(28, 'AB766', 'Lift Up!', 'Building Relationships And Influencing Others Through Encouragement', 'Barnabas Senoga', 'Motivational / Inspirational', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '4.15', '2.91', NULL, NULL, NULL, 'eyJpdiI6IklSQ3hOZEVKVkg5WlhqWE9pbFFCTnc9PSIsInZhbHVlIjoiQnlxdVJUL0puTjAycURGMjdVdkN2R3BqbEJzeFJSa1pzSUEza1QrTm8yQTRBNFlVZnoyekdZK0FNckh5MW04RCIsIm1hYyI6IjZlNzJmYjg2ZjgyNTVkNmMxYzBlM2Y4NmZhMDAxYmU2N2IyODg5NDk0M2RjODY3NWU4ZDNlMzA5MjY5ZDE0OWUiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Lift-Up_Barnabas-Senoga.jpg', 'Ebook', '180', NULL, NULL, 'English', 'Encouragement, Relationships, Inspiration, Discipleship', '978-9970-663-10-1', 'Grace Nimaro', NULL, 'Honey Badger Limited', NULL, 'bookpreviews/ebooks/Lift-Up_Barnabas-Senoga.epub', NULL, 'In a world of uncertainty, we all need a lift. This book offers support and guidance on how to get back up when life has tried to press you down. We all experience disappointment from time to time and it is amazing what a timely word of encouragement can do to change your perspective and give you hope for another day. Through real-life stories, meaningful life quotes, and encouragement from the Word of God, you will be encouraged to stay the course.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2021', '0000-00-00 00:00:00', 'Barnabas Senoga', 'Author'),
(29, 'AB676', 'Fifteen Years', NULL, 'Bernice Muwonge', 'Short Stories & Fables', NULL, NULL, 'East-African', 'Ubuntu (Equality Plan- 35%) $0.99 to $200', '$', '0.99', '0.35', NULL, NULL, NULL, 'eyJpdiI6IkdxQ2JXVUZEbGI0Z2NVNUdNeGtSNmc9PSIsInZhbHVlIjoiTDVPV3VWRGhGbVl3ZTFkcDRLYWFUcUMrQ1RxTmNlSEl6SGY2bEZkUDdIU09ZSHA0OXEzc2ZwSU8xWk1hc1FlSHJpL0hlS01vMEVwN3lndFppNnF0L0E9PSIsIm1hYyI6Ijc3ZjEzMjNkNzc2YWYzNGUwMGJhNTAxNDI2ZDVhYmRkMGEzNzk0MzRlZTFlMmNiNGZjM2E4MmZiNTQwMDFiZWEiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Fifteen-Years_Bernice-Muwonge.jpg', 'Ebook', '8', NULL, NULL, 'English', 'Rhinos, Black Rhino, Animals, Nature, Zoo, Captivity, Freedom', '9780998856995', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Fifteen-Years_Bernice-Muwonge.epub', NULL, 'Fifteen years is a short story using literary word play to speak about a news headline that was released about the Western Black Rhinos. Using a mix of poetry and pose, this young author puts the reader in the shoes of the rhino as she weaves a story of life, loss and the importance of freedom.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Bernice Muwonge', 'Author'),
(30, 'AB647', 'Limitless', 'Break The Barriers & Soar Into Your True Identity', 'Apollo Kaggwa', 'Christian Living', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '3.99', '2.79', NULL, NULL, NULL, 'eyJpdiI6IktOb2RVeUIzeE4rTmJOMnBBVXNGcHc9PSIsInZhbHVlIjoiUUozVk5Lb2hFNWEyRjhXa0xIbkxvZ0daQVVkOTcxbjBDOHVTZXI3WWxGZmswOUNJczVDSHNnOUwrandFZnliaiIsIm1hYyI6IjMzY2RjNGRlZjAxMDdiZWNhZjVhNmU4ODgyOWM3YjY5YWRmMzU4YmQ3Mzk0NjlhN2U2ODdmMjU0MWEzM2M3YjUiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Limitless_Apollo-Kaggwa.jpg', 'Ebook', '186', NULL, NULL, 'English', 'Identity, Image, Purpose, Calling, Overcoming, Barriers, Success', '9780998856919', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Limitless_Apollo-Kaggwa.epub', NULL, 'Are you tired of being defined by what the world thinks you are? Limitless opens the door for you to be the BEST YOU that you can be. You should not settle for what your family says you are. You should not settle for what your friends or your society says you should be. You should be who God created you to be! The power to be LIMITLESS lives inside of you. Limitless gives you the keys to unlock the real you so you can break the barriers that hold you back and soar into your true identity! It is time to SOAR!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2020', '0000-00-00 00:00:00', 'Apollo Kaggwa', 'Author'),
(31, 'AB375', 'Think You Can', 'Your Imaginative Power Is Your Creative Ability', 'Ivan Mawanda', 'Christian Living', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '5.00', '2.75', NULL, NULL, NULL, 'eyJpdiI6IkxUM1FRL09jcFYveG5SazBRL0I1Z2c9PSIsInZhbHVlIjoiT0cvUk43Y1FheDJBbUVCRW13Z2F0UkVtdHpvRDF6M1RNcXpWRFNEcHZmM1VjQThKR3g1a2wzYlM5MWw3YzUrbEVTbis2a1BsZzJ0cTlLSHhLdHVlaEE9PSIsIm1hYyI6IjEzNmRiZjE1YWJkYmM0MWI2MDhkNWE5NDhjZjlhYzVkNmVkMWMxZDM3ZTU5NGVkMzE3MTg2MmIxNDczN2NjNzgiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Think-You-Can_Ivan-Mawanda.jpg', 'Ebook', '126', NULL, NULL, 'English', 'Thinking, Thoughts, Power of Imagination', '9789970962105', 'Pamella Magino', 'Nabukwasi Brenda', 'Self Publication', NULL, 'bookpreviews/ebooks/Think-You-Can_Ivan-Mawanda.epub', NULL, 'Think You Can emphasizes your progress beyond imagination. Aggressive but dignified and frank-filled in nature, this is a noble tool to build and encourage the voice of reason with every opportunity that avails itself so that you can have an excellent ending. Life is what our thoughts make it. What we are today is as a result of what we think; thoughts are the building blocks of life.\r\n\r\nJust as physical exercise increases your chances for health, mental exercise increases your chance for wealth. Your ability to think long term is a developed skill. As you get better at it, you become more able to predict with increasing  accuracy what is likely to happen to you in the future as a result of your actions in the present. This is a quality of a superior thinker.\r\n\r\nSo, what’s the best way to exercise your mind? Personal development, here’s a terrific offer: a no-obligation coaching consultation to see how coaching can help create the life of abundance you’re seeking.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2018', '0000-00-00 00:00:00', 'Ivan Mawanda', 'Author'),
(32, 'AB990', '5 Things Every Young Person Should Know', NULL, 'Henry Muguluma', 'Young Adults - Christian Non-fiction', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '3.99', '2.79', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/5-Things-Every-Young-Person-Should-Know_Henry-Muguluma.jpg', 'Ebook', '208', NULL, NULL, 'English', 'Purpose, Calling, Youth, Identity,', '9789970989409', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/5-Things-Every-Young-Person-Should-Know_Henry-Muguluma.epub', NULL, 'INSIDE THIS BOOK You will find powerful keys to achieving your dreams and living a rewarding, significant, and more fruitful life than you ever thought possible. 5 Things Every Young Person Should Know is written in a language that is simple to understand, with real-life stories and practical lessons that young people will relate to. The principles shared in these pages have already helped many, and they will help you too if you put them into practice.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2019', '0000-00-00 00:00:00', 'Henry Muguluma', 'Author'),
(33, 'AB702', 'Believe In Your Dream', 'How To Pursue Your Personal Vision', 'Henry Muguluma', 'Christian Living', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '3.99', '2.79', NULL, NULL, NULL, 'eyJpdiI6Ii84Y3p6R3RUNy9CV3Ezd2RVOE9pa0E9PSIsInZhbHVlIjoiSFRQSFg5Q3BEMGtFYUp0d1lhdUpORzF2VDZ2RUV5T0p4S3lnRTF3ODNsQjNRWkExZHFNWXVtdHY1MDNFUC90c2VUcjFMWkgzVExKeGlhaDZOeVhDT0E9PSIsIm1hYyI6IjcyNTc1OTI0NGY1MzVhNTFiMjhhYWRmYzg1NjlkMGEwNTRmNTIzY2IwY2ZkNTRlZDg1ZjI4MTFiZmE3YmI3ZDkiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Believe-In-Your-Dream_Henry-Muguluma.jpg', 'Ebook', '138', NULL, NULL, 'English', 'Dream, Vision, Purpose, Calling, Youth', '9789970989416', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Believe-In-Your-Dream_Henry-Muguluma.epub', NULL, 'If you have a dream that you want to achieve, this book is for you! Filled with motivation and insights to help dreamers become achievers. each page is filled with real life stories to inspire your soul and give you practical guidance to help you\r\nturn your dreams into a reality.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2021', '0000-00-00 00:00:00', 'Henry Muguluma', 'Author'),
(34, 'AB261', 'Giant In Hiding', 'A Cry To The Man To Reposition Himself As Head', 'Jennifer Mudondo', 'Parenting & Family', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '4.50', '2.48', NULL, NULL, NULL, 'eyJpdiI6IkdaS0N5eTVka0tVQmZlR1B6ZmFtemc9PSIsInZhbHVlIjoiOHFLNi8zWlcwQ0Z1U2hGbFBFcTRpckJLS3pWVlNpRlFaMTRMMGNmNXgzaS81U0wrbHVnNzhGSzU1ZmlGQkhFdENEeUMzSmNtRmQyUVByb2FzTWIrYVE9PSIsIm1hYyI6ImI0M2RkYTZkMzA4MGI2OGQ1NjgzYmNjOGQxYjEwZjA1YzdhZmIzZGVjZjM4OTM1Y2JmY2Q3Y2NjZDQ4ZDQwMjMiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Giant-In-Hiding_Jennifer-Mudondo.jpg', 'Ebook', '216', NULL, NULL, 'English', 'Men, Manhood, Giant, Hiding, Roles, Husband, Headship', '9789970979806', 'Immaculate Tumwesigye, & Praise Ruhweza', NULL, 'Self', NULL, 'bookpreviews/ebooks/Giant-In-Hiding_Jennifer-Mudondo.epub', NULL, 'Giant in Hiding is a call to men everywhere to stand up and take their place of leadership and authority. When men don\'t take their place, it often results in unrest, pain and insecurity. This begins with the family and spreads to the other fabrics of society. The book opens the eyes of its reader to this reality. Urging each of us, whether as individuals or as institutions, to work together to build firm structures to support the repositioning of the male species through the building of sustainable societies that encourage co-existence, tolerance and respect between men and women.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2019', '0000-00-00 00:00:00', 'Jennifer Mudondo', 'Author'),
(35, 'AB716', 'Ink', 'Poetry Collection', 'Bernice Muwonge', 'Poetry', NULL, NULL, 'East-African', 'Ubuntu (Equality Plan- 35%) $0.99 to $200', '$', '1.99', '0.70', NULL, NULL, NULL, 'eyJpdiI6IjlSSkp4ZTZQMW9hcE5IL0NlbDBES0E9PSIsInZhbHVlIjoiZlRBMHc0NXF5NUZ0RS95eW5GYTVGbW45MmdMbzNzQ0UyTTdLejVBZ2VBVVhvVnVCNTFpREVkeEN3MWdFVUZ6bSIsIm1hYyI6ImIwYjQxYTg2NDE2OTJhNDQ4ZGQxNWEzZTFlMmE1MmQ1ZjFmNDQ3MDhjYWNiMjJjNmQ4MDUwYWU2MTlhNmI1MGMiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Ink_Bernice-Muwonge.jpg', 'Ebook', '20', NULL, NULL, 'English', 'Poetry, One Day, Second Chance, If we stopped running, When will It ever Be enough', '9781959070009', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Ink_Bernice-Muwonge.epub', NULL, 'INK is a short collection of six poems on life, love, and the things that lie between by young and upcoming author and poet;\r\nBernice Muwonge. At just 15 years, Bernice is recognized among her teachers and peers as a writer worth watching. Get her collection now and find out what all the buzz is about!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Bernice Muwonge', 'Author'),
(36, 'AB906', 'Love Is Blind', NULL, 'Bernice Muwonge', 'Dramas & Screenplays', NULL, NULL, 'East-African', 'Ubuntu (Equality Plan- 35%) $0.99 to $200', '$', '0.99', '0.35', NULL, NULL, NULL, 'eyJpdiI6IjNkeW1DeFNpVGxBelhEVFZoNzVwTmc9PSIsInZhbHVlIjoiT1l1L1JZTnB2cTBJRGVlc2cvMHdXUzY2alliRy9zeW5wSDZlRzJmakIxeVMvSy8vSDZDMW84YkdaSDQwZlVrTkh6ZjVFVEYyMUhoV0R1UlF4MnVQUnc9PSIsIm1hYyI6ImRiOGFmMGM1YTEzODQ2Y2Q4ZmFlODkyMmE1YTZhZmE0YjhkYWViZTQzMGJjOGMwN2E3OTJmNzFlOWE2YzIxYjEiLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Love-Is-Blind_Bernice-Muwonge.jpg', 'Ebook', '6', NULL, NULL, 'English', 'Love, Farewell, Changes, Seasons, Priorities', '9781959070016', 'Lena Mirembe Pira', 'Lena Mirembe Pira', 'Leap Publishers', NULL, 'bookpreviews/ebooks/Love-Is-Blind_Bernice-Muwonge.epub', NULL, 'Join in a journey of young love as Ben and Amy have the single most important conversation of their relationship thus far. Will their love stand the test of time and their changing lives? Or will the present circumstances stop their love dead in its tracks. Find out in this short screen play by emerging author, Bernice Muwonge.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Bernice Muwonge', 'Author'),
(37, 'AB288', 'Please Don\'t Cut Off My Hands', 'The Story of Rugarama: The 12 Year Old Martyr', 'Robert Kibuuka', 'Church History & Biography', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '3.99', '2.79', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Please-Dont-Cut-Off-My-Hands_Robert-Kibuuka.jpg', 'Ebook', '56', NULL, NULL, 'English', 'Martyr, Christianity, Uganda, Church History, Child Martyr', '9789970972814', NULL, 'Charles Mulungi', 'Robert Kibuuka', NULL, 'bookpreviews/ebooks/Please-Dont-Cut-Off-My-Hands_Robert-Kibuuka.epub', 'Robert Ashe', 'The story of Rugarama, the twelve year old Ugandan martyr, tells of the wrongs that befell Uganda. In the words of Robert Ashe, his friend, we need these stories to \'burn themselves deep into our souls\' if we are to take our place in truly transforming African today. This book is the first in a historical series showing the foundational role the church played in forming the nation we now call, Uganda. Open and honest, with study questions at the end of every chapter, it is an enlightening read for all, no matter your beliefs or background. Let us learn from the past as we continue to build for the future.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2021', '0000-00-00 00:00:00', 'Robert Kibuuka', 'Author'),
(38, 'AB805', 'Faded Flowers', NULL, 'Timothy Etoori', 'Historical Fiction', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '3.99', '2.79', NULL, NULL, NULL, 'eyJpdiI6Ik4zbnhPWlJJSXVWZnZ2Tm52V0d1Z2c9PSIsInZhbHVlIjoidnZpbGFHRkFsaVBFUDc1TlFXZGxqaE1BNDJjdTRzNW1oQ0oxSGZNcUNva0wyek9nd01zZ2w5bWJZMDg0ZHk3RHFUY3BkY0FDcjlHR3dvR0pyL1VwY2c9PSIsIm1hYyI6IjBhNzVhYzQwYzdhYjAxZjU3NTc0MWE2Mjc2NWE2YjczZThkNDgxZGQ1NTQ3NjEyZDM4YWJjODQwYjAwY2NhMjciLCJ0YWciOiIifQ==', '', 'bookcovers/ebooks/Faded-Flowers_Timothy-Etoori.jpg', 'Ebook', '210', NULL, NULL, 'English', 'War, Historical Fiction, Military, Uganda', '9781504934879', 'AuthorHouse UK', 'AuthorHouse UK', 'AuthorHouse UK', NULL, 'bookpreviews/ebooks/Faded-Flowers_Timothy-Etoori.epub', NULL, 'This is a journey through the turbulent history of Uganda: a walk through military coups, rebel insurgency and social violence. This fictional novel follows the lives of two men, Robert and John, living vastly different lives; Robert, an impoverished man looking for fulfillment through the church and John, a school dropout turned soldier in the brutal rebel army.  As the paths of the two men cross, will they finally find belonging and peace despite the war around them? Find out in Etoori\'s debut novel, Faded Flowers.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2014', '0000-00-00 00:00:00', 'Timothy Etoori', 'Author'),
(39, 'AB731', 'Hangin\' Out With Jesus', 'A Heartfelt Weekly Devotion For Children', 'Chrisabell Doreen Ampaire', 'Bible Study & Devotionals', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '5.00', '2.75', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Hangin-Out-With-Jesus_Chrisabell-Doreen-Ampaire.jpg', 'Ebook', '185', NULL, NULL, 'English (American)', 'Devotional', '9789970984268', 'Roxanna A. Kazibwe', 'Ezra Fambi', NULL, NULL, 'bookpreviews/ebooks/Hangin-Out-With-Jesus_Chrisabell-Doreen-Ampaire.epub', NULL, '“This devotional is God breathed! The 12 topics for each day of the month are vital for the relationship of our children with both God and with man! The level with which Doreen delves deeper into each topic of the month helps children dig even deeper into their understanding of the topic. They see firsthand what the Bible says in depth on each topic. She also uses a worksheet to help children journal allowing them to write their thoughts on each topic down This devotional will be fun and engaging and also an opportunity for your child to learn how to read their Bible on their own in the future. It’s a powerful devotional for our children to live out Luke 2:52: “And Jesus increased in wisdom and stature, and in favor with God and man.””\r\nManuela P. Mulondo\r\nCEO and Founder, The Cradle and President Early Years Foundation Uganda.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2021', '0000-00-00 00:00:00', 'Chrisabell Doreen Ampaire', 'Author');
