(40, 'AB597', 'Lessons From My Father', 'A Daughter\'s Tribute to Her Father', 'Marjorie Kasozi Sseruwo', 'Christian Living', NULL, NULL, 'East-African', 'Ubuntu (Equality Plan- 35%) $0.99 to $200', '$', '6.00', '2.10', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Lessons-From-My-Father_Marjorie-Kasozi-Sseruwo.jpg', 'Ebook', '149', NULL, NULL, 'English', 'Lessons From My Father', '9789913983679', 'Jessica Kamugisha Layodo', 'Mariez Creations', 'Marjorie Kasozi Sseruwo', NULL, 'bookpreviews/ebooks/Lessons-From-My-Father_Marjorie-Kasozi-Sseruwo.epub', NULL, 'Lessons From My Father is a daughter\'s tribute to her father. An account of her father\'s indelible impact on her life. The book highlights the different roles and scenes of her childhood and adulthood experience with her father until he was called back to his creator. \r\n\r\nOften times concerning fathers, we hear statements like; \"they lack a father figure in their lives and that is why...\" solutions have been crafted around creating a stable and enabling environment for children in families, but one cannot understate the role of a father in establishing stable families and grounded children. Thanks to those that have over the years come up with programmes to fill the gap that the lack of father figures has created in society today. \r\nMarjorie shares her childhood-father experiences carefully relating them to the reflection of the Heavenly Father, an assurance that the role of an earthly father is important and is indeed ordained by God. Her hope is that many will be stirred up to share their personal encounters with their fathers in her generation so as to revive the values that once shaped society. Her cry is that the current generation of fathers will humble themselves and learn from the older generation while at the same time seeking to raise the standard of fathers in this generation and the ones to come, drawing from God Himself, the ultimate Father of us all.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Marjorie Kasozi Sseruwo', 'Author'),
(41, 'AB67', 'Knights of Kampala Ride Again', NULL, 'Patricia Khayongo Rutiba', 'Christian Fiction', NULL, NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '4.99', '2.74', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/Knights-of-Kampala-Ride-Again_Patricia-Khayongo-Rutiba.jpg', 'Ebook', '461', NULL, NULL, 'English', 'sequel, kampala, corporate, socialites, love, romance, drama, office politics', '9789970731008', NULL, 'Edger Ampaire', NULL, NULL, 'bookpreviews/ebooks/Knights-of-Kampala-Ride-Again_Patricia-Khayongo-Rutiba.epub', NULL, 'Join in the unfolding drama in this Christian fiction series by Patricia Rutiba. Knights of Kampala Ride Again is the second and last book in the Kampala-based drama of young love, office politics and everything in between. Find out whose love can stand the test of time as faith blooms and challenges are faced head-on. Will God show up when they need Him most? Find out now in Knights Ride Again!', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2020', '0000-00-00 00:00:00', 'Patricia Khayongo Rutiba', 'Author'),
(42, 'AB197', 'Standing The Test Of Time', 'Principles for Victorious Christian Living', 'Ojeele Joseph Samuel', 'Christian Living', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '4.15', '2.91', NULL, NULL, NULL, '', '', 'bookcovers/ebooks/STANDING-THE-TEST-OF-TIME_Ojeele-Joseph-Samuel.jpg', 'Ebook', '109', NULL, NULL, 'English', 'Faith, victory, ministry preparation, Test, Time, Hope', '9789913623292', 'Kiberu Gideon', 'Male Charles', NULL, NULL, 'bookpreviews/ebooks/Standing-The-Test-Of-Time_Ojeele-Joseph-Samuel.epub', NULL, 'Ordinary people have long since risen from the ashes; therefore, those who believe they are standing should be cautious not to fall (1 Corinthians 10:12). Standing the test of time (principles for victorious Christian living), on the other hand, is accompanied by leaves of hope and proven principles of faith that arm God\'s creation with heroism and keep them from losing shape.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Published', NULL, NULL, NULL, '2022', '0000-00-00 00:00:00', 'Ojeele Joseph Samuel', 'Author'),
(43, 'AB748', 'A Journey Of Unfathomable Grace', 'My Autobiography', 'Mbabazi Charlotte', 'African Biographies & Memoirs', '1st Edition', NULL, 'East-African', 'Uhuru (Freedom Plan - 55%) $4.16 to 5.49', '$', '5.49', '3.02', NULL, NULL, '', '', '', 'bookcovers/ebooks/A-Journey-Of-Unfathomable-Grace_MbabaziCharlotte.jpg', 'Ebook', '266', NULL, NULL, 'English (Britain)', 'Autobiography, life, overcoming, widow, single mother, teenage marriage, grace, redemption', '9789913628082', 'Bwebare Nicholas', 'Nkurunziza Peter', 'Ensync Grafix Ltd ', NULL, 'bookpreviews/ebooks/A-Journey-Of-Unfathomable-Grace_MbabaziCharlotte.epub', NULL, 'The Journey of Unfathomable Grace tells a unique and deeply personal story about the life of its author, Charlotte Mbabazi. Tricked into a teenage marriage before her 18th birthday, learn how Charlotte was able to navigate education, teen motherhood, and early widowhood at just 24 years of age. How did this young mother of 3 come out on top??? Find out in this true store that will inspire and bless you to keep going, no matter what trials lie ahead of you.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Rejected', 'Rejected', 'missing parameters', NULL, '2022', '0000-00-00 00:00:00', 'Lena81', 'User'),
(44, 'AB253', 'The Everlasting Adventure', NULL, 'Erivania Manuela Janet Ikonyu', 'Young Adults - Popular Fiction', NULL, NULL, 'East-African', 'Ujamaa (Wealth Building Plan - 70%) $2 to $4.15', '$', '4.00', '2.80', NULL, NULL, '', '', '', 'bookcovers/ebooks/The-Everlasting-Adventure_Erivania-Manuela-Janet-Ikonyu.jpg', 'Ebook', '58', NULL, NULL, 'English (Britain)', 'Kindness, Happiness, Sadness, The Journey, Friendship, Young Adult, Illustrated, Youth', '9789970663217', 'William Komakech, Bwikizo Francis', 'Timothy Kigula', 'Leap Publishers', NULL, 'bookpreviews/ebooks/The-Everlasting-Adventure_Erivania-Manuela-Janet-Ikonyu.epub', NULL, 'The Everlasting Adventure, is a story about Princess Skyler Emmeny, daughter of King Roland and Queen Lola\'s visit to Litropia Kingdom. Upon her arrival, she met King Jordan and Queen Lira who introduced her to the whole kingdom from where she got new friends and that marked the beginning of her adventure. It further narrates of Princess Skyler Emmeny, as a kind and forging person, this made the whole kingdom adore her. The author uses her as an instrument to describe and show how forgiveness can bring back friendship and unity amongst people in the society.', 'I own the copyright and hold the necessary publishing rights', '', NULL, NULL, NULL, NULL, 'Rejected', 'Rejected', 'missing parameters', NULL, '2022', '0000-00-00 00:00:00', 'Erivania Manuela Janet Ikonyu', 'Author'),
