INSERT INTO `reviews` (`ID`, `BookID`, `BookTitle`, `BookAuthor`, `ReviewTitle`, `Comment`, `Rating`, `EmailAddress`, `ProfilePicture`, `FirstName`, `LastName`, `DateTimestamp`, `MagazineID`, `MagazineTitle`, `MagazineAuthor`) VALUES
(1, 'AB170', 'Letters To My Daughter', 'Hilda Ocan', 'Enjoyable Read', 'The book is captivating and fun to read. You can almost hear the author\'s voice speaking to you as you read, as if your own mother wrote the book to you. Many valuable lessons are gleaned from Hilda along the way. It is definitely worth every shilling!', '5', 'lpira@newinternational.org', 'useraccounts/Lena_Pira.jpg', 'Lena', 'Pira', '2022-07-23 22:28:05', NULL, NULL, NULL),
(2, 'AB2', 'Holy Bible | King James Version', 'Leap Publishers', 'Easy to Navigate', 'This eBible is easy to use and navigate with links to books, chapters and verses on every page. A good alternative to other online bibles or print versions.', '5', 't.l.pra525@gmail.com', 'useraccounts/Teri_Pira.jpg', 'Teri', 'Pira', '2022-07-23 22:53:19', NULL, NULL, NULL),
(3, 'AB990', '5 Things Every Young Person Should Know', 'Henry Muguluma', 'Entertaining Read', 'I love the way Henry communicates using stories from his own personal life and experiences. It makes the book very interesting and personal yet also thought provoking. I believe this book is for anyone not just young people. Thank you Henry for a work well done!', '5', 'lpira@newinternational.org', 'useraccounts/Lena_Pira.jpg', 'Lena', 'Pira', '2022-09-01 11:43:23', NULL, NULL, NULL),
(4, 'AB702', 'Believe In Your Dream', 'Henry Muguluma', 'Great Sequel', 'I believe this book is a great read by itself however, when paired with Henry’s 5 Things book I believe the two work well together to draw out a more complete picture on purpose, calling and fulfillment. Easy to read, this book is especially good for teenagers and young adults who are trying to discover the path they want to take in life.', '4', 'lpira@newinternational.org', 'useraccounts/Lena_Pira.jpg', 'Lena', 'Pira', '2022-09-01 11:47:09', NULL, NULL, NULL),
(5, 'AB278', 'Oak & Ivy', 'Paul Laurence Dunbar', 'Poetry!', 'I love how poetry lasts across the ages. Reading these you can assume they were written yesterday yet they were actually penned in the 1800s. Amazing!', '5', 't.l.pra525@gmail.com', 'useraccounts/Teri_Pira.jpg', 'Teri', 'Pira', '2022-09-01 13:44:00', NULL, NULL, NULL);
